column8:
【THREE BEAD SPOTS】<BR>
ジッパーエンド・ポケットサイドに’５０,’60年代革ジャンによく見る『３連ビーズ型』補強用スタッズを施したモデル。<BR>
<BR>
70'Sのディテールに細め袖・程よく長めの着丈を採用した DOUBLE RIDERS<BR>
ジッパーはUNIVERSAL OLD AMERICANを採用し、補強用スタッズで表情を変化させています。<BR>
<BR>
【MATERIAL】<BR>
●SHELL : COW HIDE<BR>
●LINING : COTTON / POLYESTER<BR>
<BR>
着用者：163cm　34 着用<BR>
